

CREATE TABLE `all_cities` (
  `city_name` text,
  `city_code` text,
  `state_code` text
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




CREATE TABLE `all_states` (
  `state_code` text,
  `state_name` text,
  `country_code` text
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




CREATE TABLE `bank_name_table` (
  `bank_id` varchar(10) NOT NULL,
  `bank_name` varchar(250) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `msd_agreement_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(8) NOT NULL,
  `agreement_file` varchar(100) NOT NULL,
  `description` varchar(225) DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;




CREATE TABLE `msd_comp_bank_dtl_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Bank_Name` varchar(250) NOT NULL,
  `Branch` varchar(200) NOT NULL,
  `Account_Number` varchar(20) NOT NULL,
  `IFSC` varchar(20) NOT NULL,
  `Account_Holder_Name` varchar(100) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=latin1;




CREATE TABLE `msd_comp_deposit_dtl_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `deposit_date` date NOT NULL,
  `deposit_amt` decimal(10,2) NOT NULL,
  `payment_type` varchar(20) NOT NULL,
  `received_name` varchar(100) NOT NULL,
  `deposit_transfer_bank` varchar(200) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `msd_comp_profit_dtl_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `Sr_No` int(11) NOT NULL,
  `Investor_Name` varchar(250) NOT NULL,
  `Date` datetime NOT NULL,
  `Amount_Received` decimal(10,2) NOT NULL,
  `Received_BY` varchar(250) NOT NULL,
  `Transfer_To_Bank` varchar(250) NOT NULL,
  `Tranferred_Amount` decimal(10,2) NOT NULL,
  `Trade_A/C` varchar(250) NOT NULL,
  `Trade_Amount` decimal(10,2) NOT NULL,
  `Trade_Profit` decimal(10,2) NOT NULL,
  `W/D_Req_Date` date NOT NULL,
  `W/D_Amount` decimal(10,2) NOT NULL,
  `W/D_Transfer_To_Bank` varchar(250) NOT NULL,
  `Trade_A/C_Balance` decimal(10,2) NOT NULL,
  `Trade_Transfer_To_Bank` varchar(250) NOT NULL,
  `Bank_A/C_Balance` decimal(10,2) NOT NULL,
  `Total_Balance` decimal(10,2) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `live_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=latin1;




CREATE TABLE `msd_comp_profit_loss_dtl_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pft_loss_date` date NOT NULL,
  `trade_acc_name` varchar(200) NOT NULL,
  `profit_or_loss` varchar(20) NOT NULL,
  `profit_amt` decimal(10,2) NOT NULL,
  `loss_amt` decimal(10,2) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `msd_comp_trade_dtl_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `trade_date` date NOT NULL,
  `trade_transfer_name` varchar(200) NOT NULL,
  `from_bank` varchar(200) NOT NULL,
  `trade_account` varchar(200) NOT NULL,
  `trade_amount` decimal(10,2) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `msd_comp_withdraw_dtl_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `wd_date` date NOT NULL,
  `wd_transfer_name` varchar(200) NOT NULL,
  `wd_trade _acc` varchar(200) NOT NULL,
  `wd_transfer_bank` varchar(200) NOT NULL,
  `wd_amount` decimal(10,2) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




CREATE TABLE `msd_customer_plan_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `plan_id` varchar(10) NOT NULL,
  `plan_name` varchar(100) DEFAULT NULL,
  `customer_id` varchar(10) DEFAULT NULL,
  `customer_name` varchar(100) DEFAULT NULL,
  `deposit_amt` decimal(10,2) DEFAULT NULL,
  `duration` int(11) DEFAULT NULL,
  `profit_perc` decimal(10,2) DEFAULT NULL,
  `start_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL,
  `perc_return` varchar(5) DEFAULT NULL COMMENT 'yes or no',
  `active_status` varchar(10) NOT NULL DEFAULT 'active',
  `compo_plan` varchar(10) DEFAULT NULL,
  `emp_checked` varchar(10) DEFAULT NULL,
  `emp_id` varchar(10) DEFAULT NULL,
  `emp_perc` int(11) DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=89 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `msd_ip_address_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `IP_address` varchar(225) NOT NULL,
  `user` varchar(10) DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=331 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `msd_login_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `userid` text NOT NULL,
  `username` text NOT NULL,
  `password` text NOT NULL,
  `type` text NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=119 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `msd_notification_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(10) DEFAULT NULL,
  `comment_subject` varchar(225) DEFAULT NULL,
  `comment_text` varchar(1000) DEFAULT NULL,
  `comment_type` varchar(50) DEFAULT NULL,
  `comment_status` int(11) DEFAULT '1' COMMENT '1 is notify 2 read 3 delete',
  `start_date` datetime NOT NULL,
  `exp_date` datetime DEFAULT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=142 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `msd_payout_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `customer_id` varchar(20) NOT NULL,
  `customer_name` varchar(200) NOT NULL,
  `payout_amount` decimal(10,2) NOT NULL,
  `deposit_amount` decimal(10,2) NOT NULL,
  `principle_amount` decimal(10,2) NOT NULL,
  `type` varchar(20) NOT NULL,
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=42 DEFAULT CHARSET=latin1;




