  `agent_perc3` decimal(10,2) NOT NULL DEFAULT '0.00',
  `agent_profit_amount3` decimal(10,2) NOT NULL DEFAULT '0.00',
  `agent_id4` varchar(20) DEFAULT NULL,
  `agent_perc4` decimal(10,2) NOT NULL DEFAULT '0.00',
  `agent_profit_amount4` decimal(10,2) NOT NULL DEFAULT '0.00',
