CREATE TABLE `msd_register_comp_agent_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `agent_id` varchar(8) NOT NULL,
  `admin_id` varchar(8) NOT NULL,
  `reference_id` varchar(11) NOT NULL,
  `agent_name` text NOT NULL,
  `agent_mobile` varchar(11) NOT NULL,
  `agent_email` varchar(50) NOT NULL,
  `agent_password` text NOT NULL,
  `agent_re_password` text NOT NULL,
  `agent_address` text NOT NULL,
