  `emp_state` text NOT NULL,
  `emp_gender` text NOT NULL,
  `emp_image` text NOT NULL,
  `emp_role_type` varchar(9) NOT NULL DEFAULT 'employee',
  `status` int(11) NOT NULL DEFAULT '0',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`,`emp_id`,`emp_email`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4;




CREATE TABLE `msd_register_comp_manager_table` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `mgr_id` varchar(8) NOT NULL,
  `reference_id` varchar(30) NOT NULL,
