  `reference_id` varchar(20) NOT NULL,
  `agent_id` varchar(20) NOT NULL,
  `register_fname` varchar(225) NOT NULL,
  `register_mname` varchar(100) NOT NULL,
  `register_lname` varchar(250) NOT NULL,
  `register_dob` date DEFAULT NULL,
  `register_nominee_relation` varchar(200) NOT NULL,
  `register_nominee_name` varchar(200) NOT NULL,
  `register_addr1` varchar(250) NOT NULL,
  `register_addr2` varchar(250) NOT NULL,
  `register_city_id` int(11) NOT NULL,
  `register_city` varchar(250) NOT NULL,
  `register_state_id` int(11) NOT NULL,
  `register_state` varchar(250) NOT NULL,
  `register_pincode` varchar(250) NOT NULL,
  `register_country` varchar(20) NOT NULL,
  `register_mobno` varchar(12) NOT NULL,
  `register_email` varchar(100) NOT NULL,
  `register_password` varchar(100) NOT NULL,
  `register_repassword` varchar(100) NOT NULL,
  `register_invest_amount` float NOT NULL,
  `customer_aggre_month` int(11) DEFAULT NULL,
  `aggr_plan_start_date` date DEFAULT NULL,
  `aggr_plan_end_date` date DEFAULT NULL,
  `register_profit_perc` varchar(5) NOT NULL,
  `register_agent_profit_perc` varchar(5) NOT NULL,
  `register_image` varchar(200) NOT NULL,
