  `register_emp_id` varchar(10) DEFAULT NULL,
  `register_emp_name` varchar(100) DEFAULT NULL,
  `register_emp_perc` int(11) DEFAULT NULL,
  `register_type` varchar(11) NOT NULL DEFAULT 'customer',
  `register_approved_status` varchar(15) NOT NULL DEFAULT 'not approved',
  `register_activate_status` varchar(20) NOT NULL DEFAULT 'deactivate',
  `agent_login_id` varchar(20) DEFAULT NULL,
  `agent_login_checked` varchar(5) NOT NULL DEFAULT 'NO' COMMENT 'CHECKED YES OR NO',
  `comment` varchar(225) DEFAULT NULL,
  `register_status` char(1) NOT NULL DEFAULT '0' COMMENT '0-add,1-edit,2-delete',
  `date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8mb4;




